 import React, { Component } from 'react'

 
 export class Form extends Component {
     render() {
         return (
             <div>
                <form id="searchForm">
			        <h3>Begin the searching!</h3>
			        <input placeholder="Search Movies..."></input>
		
			<button id="search-btn">Search</button>
		</form>
             </div>
         )
     }
 }
 
 export default Form
